trailingComments.value:
*
     * Renders attributes based on the keys and attribute data.
     * @example
     * attributeData = { required = "true"};
     * attributeKeys = ["required"];
     * 
     * // Becomes: 
     * html = 'required = "true"'
     * 
     * @type {String}

